				{/* 	</dd> */}
				{/* </div> */}
				<Entry
					emoji="üí™ "
					aria-label="Tense Biceps"
					description="‚ÄúYou can do that!‚Äù or ‚ÄúI feel strong!‚Äù Arm with tense biceps. Also	used in connection with doing sports, e.g. at the gym. "
				/>
				<div className="term">
					<dt>
						<span className="emoji" role="img" aria-label="Tense Biceps">
							üôè
						</span>
						<span>Person With Folded Hands</span>
					</dt>
